    "2015-06-17T01:58:03.593169",nt"name": "report-on-a-brief-biological-survey-of-davidof-khvostof-and-little-kiska-islands-1-2-july-",nt"isopen":
    false,nt"url": null,nt"notes": "No sign of Arctic foxes were found on any
    of the islands. Te presence of glaucous winged gulls nesting abundantly on the slopes
    of Davidof and Khvostof Islands is a priori evidence that foxes do not occur. Davidof
    and Khvostof are not suitable for release of Aleutian Canada geese due to small
    size and lack of suitable nesting sites. Suitability of Little Kiska is difficult
    to evaluate. A total of 22 species of birds was recorded during the survey of the
    islands, 14 on Davidof, 7 on Pyramid, 10 on Khvostof, and 14 on Little 4 Kiska.",nt"license_title":
